import React, { Component } from 'react';

class CreateContent extends Component {
  render() {
    return (
      <article>
        <h2>Create</h2>
        <form>
          <input type="text" name="title" placeholder="title" />
        </form>
      </article>
    );
  }
}
export default CreateContent;
